import React, { Component } from 'react';
import '../App.css';
import './Home.css';
import LogoJeu from '../img/League_of_Legends_Logo.png';
import ImgJeu from '../img/League_of_Legends_Img.png';

class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div>
        <img src={ImgJeu} className="Addvertising-img" alt="" />
        <div className="Addvertising">
          <img src={LogoJeu} className="Logo-jeu" alt="" />
          <h1>
            Les tutos
            {' '}
            <span className="Semi-bold-Italic">League of Legends</span>
            {' '}
            sont maintenant disponibles sur Up&Win !
          </h1>
          <button type="button" className="Button">
            Go !
          </button>
        </div>
      </div>
    );
  }
}

export default Home;
